import React from 'react';
import './commitcard.css';

function Displaycard() {
    return(
      <div className = "profile">
        <div className= "photo1">
          <img src = {data.photo} alt="Bijayalaxmi"/>
          <span>{data.emailid}</span>
        </div>
      </div> 
    );
  }
  export default Displaycard
  React.render(<Displaycard 
  photo = "https://i.pinimg.com/236x/e2/72/e4/e272e4c7495706cf18f565e2c0d36078--baby-harry-potter-rainbow-baby.jpg" emailid = "yrdesai@asu.edu"/>, document.querySelector('#commitcard'));
